# encoding=utf8
import matplotlib.pyplot as plt
import json


# 绘制线路分布图
def route_showV1(routeSol, pickupSol, deliverySol):
    routeList = routeSol['routeInfo']  # 线路集合
    pickupList = pickupSol['pickup']  # 提货点
    delivery = deliverySol['delivery']  # 配送点
    # 画S图
    plt.figure(1)
    for u in range(len(routeList)):
        vertexDelivery = routeList[u]['vertexDelivery']  # delivery id的集合
        # 通过 delivery 的 key 在delivery中找到相应的lng lat 作为 X Y
        deliveryDict = {'X': [], 'Y': [], 'id': []}
        for vertex in vertexDelivery:
            id = str(vertex['id'])
            deliveryDict['X'].append(delivery[id]['lng'])
            deliveryDict['Y'].append(delivery[id]['lat'])
            deliveryDict['id'].append(id)
            plt.text(delivery[id]['lng'], delivery[id]['lat'], id, size=11)
        # 通过 pickup 的数据
        pickupDict = {'X': [], 'Y': []}
        for pickup in pickupList:
            pickupDict['X'].append(pickup['lng'])
            pickupDict['Y'].append(pickup['lat'])
        # plt.plot(pickupDict['X'], pickupDict['Y'])
        plt.scatter(pickupDict['X'], pickupDict['Y'], marker='h', s=200)
        plt.plot(pickupDict['X'] + [deliveryDict['X'][0]], pickupDict['Y'] + [deliveryDict['Y'][0]])
        plt.plot(deliveryDict['X'], deliveryDict['Y'], marker='o', markerSize=5,
                 label=''.join(["线路", str(u)]))
        plt.rcParams['font.sans-serif'] = ['SimHei']  # 用来正常显示中文标签
    plt.legend()
    plt.xlabel('经度')
    plt.ylabel('纬度')
    plt.grid()
    plt.show()


# 每条线路的属性对比
def attribute_constraints(attList, attThreshold, attName=None):
    if attName is None:
        attName = '指标'
    xw = range(1, 1+len(attList))
    xwt = range(1, 1+len(attThreshold))
    plt.figure(2)
    plt.plot(xw, attList, linewidth=3, marker='o', markersize=12, label='货物')
    plt.plot(xwt, attThreshold, linewidth=3, marker='s', markersize=12, label='车辆')
    plt.legend()
    plt.grid()
    plt.xlabel('车辆序号', FontSize=14)
    plt.ylabel(attName, FontSize=14)
    plt.rcParams['font.sans-serif'] = ['SimHei']  # 用来正常显示中文标签
    plt.show()


# 绘制 pickup delivery 的散点图
def pickup_delivery_distribution(pickupSol, deliverySol):
    pickupList = pickupSol['pickup']
    delivery = deliverySol['delivery']
    deliveryKeys = list(delivery.keys())  # delivery 的 Key 集合
    # 画图
    plt.figure(3)
    # 门店的经纬度
    deliveryDict = {'X': [], 'Y': []}
    for u in range(len(deliveryKeys)):
        deliveryDict['X'].append(delivery[deliveryKeys[u]]['lng'])
        deliveryDict['Y'].append(delivery[deliveryKeys[u]]['lat'])
    plt.scatter(deliveryDict['X'], deliveryDict['Y'], s=50)
    # 仓库的经纬度
    pickupDict = {'X': [], 'Y': []}
    for u in range(len(pickupList)):
        pickupDict['X'].append(pickupList[u]['lng'])
        pickupDict['Y'].append(pickupList[u]['lat'])
    plt.scatter(pickupDict['X'], pickupDict['Y'], marker='h', s=200)
    plt.legend(['delivery point', 'pickup point'])
    plt.grid()
    plt.show()


